B.FI=A.a(s(["F\xfcr die gezeigte Schaltung kann die \xdcbertragungskennlinie grafisch konstruiert werden, indem das Ausgangskennlinienfeld IC=IC(UCE,UBE) des Transistors und die Kennlinie IC(UCE) des Widerstandes in ein Diagramm eingetragen werden. F\xfcr einen gegebenen Wert von UBE ergibt dann der Schnittpunkt der entsprechenden Transistorkennlinie mit der Widerstandsgeraden den dazugeh\xf6rigen Wert f\xfcr UCE.","Die Steigung dUCE/dUBE der \xdcbertragungskennline entspricht der Kleinsignalspannungsverst\xe4rkung Au. F\xfcr Werte UBE unter etwa 0,6V ist die Steigung und damit die Verst\xe4rkung etwa Null, da der Transistor sperrt. F\xfcr gro\xdfe Werte von UBE geht die Verst\xe4rkung ebenfalls gegen Null, da der Transistor in S\xe4ttigung geht."]),t.s)
